  return (

    <div className="map-container">
        <ComposableMap>
            <Geographies geography = {json}>
                {({geographies}) => geographies.map(geo => <Geography geography = {geo} key = {geo.rsmkey} />)}
            </Geographies>
        </ComposableMap>
    </div>

  );
}

